isSafariInIdevice = function(){
   if (/Safari[\/\s](\d+\.\d+)/.test(windows.navigator.userAgent)) {
      return 'ontouchstart' in window && detectOs() === "mac";      
   }
   return false;
};

DELIMITER ;;
CREATE TRIGGER BEFORE_INSERT_INOUTPUT_ITEM
BEFORE INSERT ON sa_inoutput_item
FOR EACH ROW
BEGIN
DECLARE tmpStatus varchar(30);
SELECT status INTO tmpStatus FROM sa_inoutput WHERE id = NEW.inoutput_id LIMIT 1;
SET NEW.status = tmpStatus;

SET @tmpCreateTime = null;
SELECT create_time INTO @tmpCreateTime FROM sa_inoutput WHERE id = NEW.inoutput_id LIMIT 1;
SET NEW.create_time = @tmpCreateTime;

SET @tmpWarehouseId = null;
SELECT warehouse_id INTO @tmpWarehouseId FROM sa_inoutput WHERE id = NEW.inoutput_id LIMIT 1;
SET NEW.warehouse_id = @tmpWarehouseId;

SET @tmpType = null;
SELECT type INTO @tmpType FROM sa_inoutput WHERE id = NEW.inoutput_id LIMIT 1;
SET NEW.type = @tmpType;

SET @tmpDeliveryTime = null;
SET @tmpTypeValue = null;
IF @tmpType = 'out' THEN
SELECT expected_delivery_time INTO @tmpDeliveryTime FROM sa_inoutput WHERE id = NEW.inoutput_id LIMIT 1;
SELECT out_type INTO @tmpTypeValue FROM sa_inoutput WHERE id = NEW.inoutput_id LIMIT 1;
END IF;
IF @tmpType = 'in' OR @tmpType = 'order_in' THEN
SELECT in_time INTO @tmpDeliveryTime FROM sa_inoutput WHERE id = NEW.inoutput_id LIMIT 1;
SELECT in_type INTO @tmpTypeValue FROM sa_inoutput WHERE id = NEW.inoutput_id LIMIT 1;
END IF;
SET NEW.delivery_time = @tmpDeliveryTime;
SET NEW.type_value = @tmpTypeValue;

END;;

CREATE TRIGGER AFTER_UPDATE_INOUTPUT
AFTER UPDATE ON sa_inoutput
FOR EACH ROW
BEGIN

UPDATE sa_inoutput_item SET status = NEW.status WHERE inoutput_id = NEW.id;
UPDATE sa_inoutput_item SET warehouse_id = NEW.warehouse_id WHERE inoutput_id = NEW.id;

IF NEW.type = 'out' THEN
UPDATE sa_inoutput_item SET delivery_time = NEW.expected_delivery_time WHERE inoutput_id = NEW.id;
UPDATE sa_inoutput_item SET type_value = NEW.out_type WHERE inoutput_id = NEW.id;
END IF;

IF NEW.type = 'in' OR NEW.type = 'order_in' THEN
UPDATE sa_inoutput_item SET delivery_time = NEW.in_time WHERE inoutput_id = NEW.id;
UPDATE sa_inoutput_item SET type_value = NEW.in_type WHERE inoutput_id = NEW.id;
END IF;
END;;
DELIMITER ;
